import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import {ForgotPassword, Register, Home, Profile, FeedMain, Login} from "../screens";
import PrivateRoute from "../layout/private/PrivateRoute";
import PublicRoute from "../layout/public/PublicRoute";
import CreatePost from "../screens/"


const Navigation = () =>{

    return (
        <BrowserRouter>
          <Switch>
            <PublicRoute exact path = "/" component = {Home}/>
            <PublicRoute exact path = "/register" component = {Register}/>
            <PublicRoute exact path = "/forgotpassword" component = {ForgotPassword} />
            <PublicRoute exact path = "/login" component  = {Login}/>
            <PrivateRoute exact path = "/profile" component = {Profile}/>
            <PrivateRoute exact path = "/feeds" component = {FeedMain}/>
          </Switch>
        </BrowserRouter>
      );
}

export default Navigation;
